package org.brainteam.lunchbox.domain;import static org.testng.Assert.assertSame;import java.util.Arrays;import java.util.Collections;import java.util.List;import org.testng.annotations.Test;@Test(groups="unit")public class UserTest {	@Test	public void testComparable() {		User u1 = new User();		u1.setFullName("Usain Bolt");				User u2 = new User();		u2.setFullName("Lance Armstrong");				User u3 = new User();		u3.setFullName("Lewis Hamilton");				List<User> users = Arrays.asList(u1, u2, u3);		Collections.sort(users);				assertSame(users.get(0), u2);		assertSame(users.get(1), u3);		assertSame(users.get(2), u1);	}	}